import base64
from PIL import Image
from io import BytesIO

# Example function to decode the base64 image and convert to a binary pixel map
def decode_and_convert(base64_data, width, height):
    # Decode base64 to get the image data
    img_data = base64.b64decode(base64_data)
    
    # Open the image using Pillow
    img = Image.open(BytesIO(img_data))
    
    # Resize the image to fit the desired dimensions (120x32)
    img = img.resize((width, height))
    
    # Convert image to grayscale (1 bit per pixel)
    img = img.convert('1')  # '1' mode for 1-bit pixels
    
    # Convert to binary (0 is black, 1 is white)
    pixel_map = []
    for y in range(height):
        row = []
        for x in range(width):
            pixel = img.getpixel((x, y))
            row.append(1 if pixel == 255 else 0)  # 255 is white in grayscale, 0 is black
        pixel_map.append(row)
    
    return pixel_map

# Function to print the pixel map
def print_pixel_map(pixel_map):
    for row in pixel_map:
        # Print each row as a space-separated string of 0s and 1s
        print("".join(str(pixel) for pixel in row))

# Base64 data for the images
# https://base64.guru/converter/encode/image
img1_base64 = ""

print_pixel_map(decode_and_convert(img1_base64, 120, 32))